import React from 'react'

const Cards = ({results}) => {
    let display;

    if (results){
        display = results.map(x=>{
            let {id, name} = x
            return(<div key={id } className='col-4'>
                {name}
            </div>)
        });
    }else{
        display = "No existe" ;
    }



  return (
    <div>{display}</div>
  )
}

export default Cards
